import React, { useState } from 'react';
import Modal from 'react-modal';
import './Gallery.css';
import radImage from './galleryimages/rad.jpg';

export default function Gallery() {
  const [modalIsOpen, setModalIsOpen] = useState(false);

  const openModal = () => {
    setModalIsOpen(true);
  };

  const closeModal = () => {
    setModalIsOpen(false);
  };

  return (
    <div>
      <h1>Photo Gallery grid</h1>
      <div className="photo-grid">
        <div
          className="card card-tall card-wide"
          style={{
            backgroundImage: `url(${radImage})`,
          }}
          onClick={openModal}
        >
          1
        </div>
        <div
          className="card card-tall"
          style={{
            backgroundImage:
              "url('https://images.unsplash.com/photo-1583585635793-0e1894c169bd?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=913&q=80')",
          }}
        >
          2
        </div>
        <div
          className="card"
          style={{
            backgroundImage:
              "url('https://images.unsplash.com/photo-1583531172005-814191b8b6c0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=975&q=80')",
          }}
        >
          3
        </div>
        {/* Rest of the cards */}
      </div>

      <Modal
        isOpen={modalIsOpen}
        onRequestClose={closeModal}
        contentLabel="Enlarged Image"
        className="modal"
        overlayClassName="modal-overlay"
      >
        <img src={radImage} alt="Enlarged" />
      </Modal>
    </div>
  );
}
